[loggers]keys=root, create_objects, pres_run_data_ingest, validations, pres_run_data_preprossing, pres_run_data_transform, data_store[handlers]keys=fileHandler[formatters]keys=fileFormatter[logger_root]level=DEBUGhandlers=fileHandler[logger_create_objects]level=DEBUGhandlers=fileHandlerqualname=create_objectspropagate=0[logger_pres_run_data_ingest]level=DEBUGhandlers=fileHandlerqualname=pres_run_data_ingestpropagate=0[logger_pres_run_data_preprossing]level=DEBUGhandlers=fileHandlerqualname=pres_run_data_preprossingpropagate=0[logger_validations]level=DEBUGhandlers=fileHandlerqualname=validationspropagate=0[logger_data_store]level=DEBUGhandlers=fileHandlerqualname=data_storepropagate=0[logger_pres_run_data_transform]level=DEBUGhandlers=fileHandlerqualname=pres_run_data_transformpropagate=0[handler_fileHandler]class=FileHandlerlevel=DEBUGformatter=fileFormatterargs=('../logs/presc_run_pipeline.log','a')[formatter_fileFormatter]format = '%(asctime)s - %(name)s - %(levelname)s - %(message)s'datefmt='%db- %b - %y %H:%M:%S'